import React from 'react'
import styled from 'styled-components'
import { BrowserFingerprint } from "browser_fingerprint";

const Title = styled.h1`
  color: red;
  font-size: 50px;
`

export default () => {

  const bla = new BrowserFingerprint({
    cookieKey: "fingerPrint",
    toSetCookie: true,
  })

  console.log(bla.savedHashedPid)

  return (
    <Title>bla</Title>
  )
}
